import React from 'react'
import '../sass/bootstrap.min.css';
import '../sass/head.scss';
import '../sass/style.scss';
import Lottie from 'react-lottie';
import Logo from '../componets/logo.json';
// import image_slider0 from '../img/image_slider0';
// import image_slider1 from '../img/image_slider1';
// import image_slider2 from '../img/image_slider2';
// import slider_0 from '../img/slider_0.svg';

import { FaBars } from "react-icons/fa";
import { NavLink as Link } from "react-router-dom";
import styled from "styled-components";

export const Nav = styled.nav`
    background: orangered;
    height: 85px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 0.2rem calc((100vw - 1000px) / 2);
    z-index: 12;
`;
export const NavLogo = styled(Link)`
  cursor: pointer;
  color: #fff;
  font-size: 2rem;
  text-decoration: none;

`;

export const NavLink = styled(Link)`
color: #fff;
display: flex;
align-items: center;
text-decoration: none;
padding: 0 1rem;
height: 100%;
cursor: pointer;
&.active {
  color:black;
}
&:hover {
  color: black;
}
`;

export const Bars = styled(FaBars)`
  display: none;
  color: #fff;
  @media screen and (max-width: 768px) {
    display: block;
    position: absolute;
    top: 0;
    right: 0;
    transform: translate(-100%, 75%);
    font-size: 1.8rem;
    cursor: pointer;
  }
`;

export const NavMenu = styled.div`
  display: flex;
  align-items: center;
  margin-right: -24px;

  @media screen and (max-width: 768px) {
    display: none;
  }
`;

export const NavBtn = styled.nav`
  display: flex;
  align-items: center;
  margin-right: 24px;

  @media screen and (max-width: 768px) {
    display: none;
  }
`;

export const NavBtnLink = styled(Link)`
  border-radius: 4px;
  background: transparent;
  padding: 10px 22px;
  color: #fff;
  outline: none;
  border: 1px solid #fff;
  cursor: pointer;
  transition: all 0.2s ease-in-out;
  text-decoration: none;
  margin-left: 24px;
  &:hover {
    transition: all 0.2s ease-in-out;
    background: #fff;
    color: #808080;
  }
`;
class Header extends React.Component {
      render(){

  const Logo_animation = {
    loop: false,
    autoplay: true, 
    animationData: Logo,
  };
          return(
            <>
<div className="topnav">
   <div className="topnav-right row">
      <ul>
         <li><a className="active" href="#home">
            INICIO
            </a>
         </li>
         <li>
            <a href="#carousel">
            PERSONALISE{" "}
            <em className="subtopnav">
            Sua imagem!
            </em>
            </a>
         </li>
         <li>
            <a href="#pageC">
            ANIME{" "}
            <em className="subtopnav">
            {" "}
            <br /> Suas ideias!
            </em>
            </a>
         </li>
         <li>
            <a href="#contact">CONTATO</a>
         </li>
      </ul>
   </div>
</div>

             <Lottie options={Logo_animation}
                height={720}
                width={720}
                style={{ left:"0", right:"0" }}
                />
            </>
          )
      }
}
export default Header
